import React from 'react';

function Card({id, name, link, likes}) {
    return(
        <div className="element" key={id}>
            <button type="button" className="element__delete-button" name="delete-button"></button>
            <img className="element__picture" alt={name} src={link} />
            <div className="element__caption">
                <h2 className="element__name"></h2>
                <div className="element__likes">
                    <button type="button" className="element__like-button" name="like-button"></button>
                    <p className="element__likes-number">{likes}</p>
                </div>
            </div>
        </div>
    );
}

export default Card;
